          "description": "This book is in Russian. \"The Storm In My Mind\" by Sergey Stepanov – poetry from the soul! Composition that is excellent! Joy that is excellent! Excellent spirit!.. Sounds in center! Poet Sergey Stepanov is the renowned author in their own nation. It's a sizable honor for his writing that is imaginative. He was called the poet of the nation in 2011 by visitors. The very best verses compiled by the poet within the 2012-2015 time were incorporated by this guide. Today Sergey Stepanov – among the many well known writers, printed in literary publications of the nation. Euro is composed in by him. Poet Sergey Stepanov – poetry on Top. Please, VIEW Sample Audience! \"Стихия Я\" – поэт Сергей Степанов представляет новую книгу! \"The Storm In My Mind\" by Sergey Stepanov! Стихи Сергея Степанова – поэзия, что передается от сердца к сердцу. Книги Сергея Степанова – стихи как стихия! Поэзия Степанова – мир ярких метафор. Ожидание чуда на каждой странице. \"Стихия Я\" Сергея Степанова – сборник произведений замечательного поэта! Поэт Сергей Степанов. Да!.. Музыка слова. Звучит и резонирует в душах. Поэт Сергей Степанов – голос современной поэзии. Поэзия – во!.. КЛИКАЙ Sample! *** В 2012 году поэт Сергей Степанов удостоен Первой премии литературного конкурса \"Арча\" – одного из крупнейших на постсоветском пространстве. Традиционно этот конкурс проводится под патронатом Международного Иссык-Кульского форума им. Чингиза Айтматова – на родине этого всемирно известного писателя в 2011-м Сергей Степанов назван \"Поэтом года\". В 2013–2014 гг. Степанов зачислялся в номинанты конкурса \"Поэт года\" России. Сегодня Степанов – в числе самых известных современных поэтов своей страны. Изданный Степановым в 2012 г. объемный сборник стихов \"Азият\" сразу вывел автора в ряды первых. \"Это своего рода дверь в мир настоящей, живой мысли, что раскрывается перед нами благодаря трепетному и глубокому пониманию слова\", – так высказался Аскар Айтматов, экс-министр иностранных дел Киргизии, о поэзии Сергея Степанова. \"Книги Сергея Степанова увлекают с любой наугад открытой страницы...\" – отзывается о творчестве этого поэта российская газета \"Комсомольская правда\". \"Поэт Сергей Степанов сразу, с первой книги ярко заявил о себе. Я всегда рад новым проявлениям в поэзии, новым подходам. Желаю Сергею Степанову дальнейших успехов на этом поприще!\" – напутствовал автора некогда один из лучших друзей Андрея Вознесенского – Омор Султанов, Народный поэт Киргизии, член секретариата Международного сообщества писательских союзов (СНГ). В сборник \"Стихия Я\" Сергея Степанова (The Storm In My Mind by Sergey Stepanov) вошли произведения последних лет. Книги поэта Сергея Степанова погружают в океан живительного слова и глубокого осмысления Бытия и, благодаря таинственному духовному единению читателя и поэта, позволяют каждому познать новые яркие стороны своего собственного \"Я\". \"Стихия Я\" поэта Сергея Степанова. Эта книга – что надо книга!.. Поэзия Сергея Степанова – скачать здесь и сейчас!.. *** Поэт Сергей Степанов – о главном: – Привет всем, кто умеет читать между строк и видеть незримое! Я – русский поэт. Поделюсь с вами небольшим воспоминанием. Однажды я повстречал на улице бродячего пса. Он бросился на меня с лаем: дескать, если не стану относиться к жизни серьезно, то погибну на улице как собака. Я прислушался к предсказаниям. И стал известным журналистом, хорошим газетным редактором. А затем основательно занялся литературным трудом. Пришли кое-какие творческие победы, а с ними – скромные награды. Теперь, бывает, я встречаю на улице других писателей – моих друзей. Когда они в настроении, то тоже бросаются ко мне – с объятиями: глядя прямо в глаза, поздравляют с успехами и даже иногда утверждают, что я самый настоящий поэт. Не берусь спорить с ними... Но мне так не хватает того самого пса, случайно встреченного на улице!.. Потому что только этот бродяга однажды дал мне совет, который действительно пригодился. Живи сейчас, здесь и всерьез! Это я и пытаюсь делать в литературе.",
