          "publisher": "AuthorHouse",
          "publishedDate": "2015-01-21",
          "description": "Three sailors embark on a road trip from Santa Barbara to Ensenada, Mexico to take delivery of a sailboat. But before they can leave, Tom, who is the captain of the vessel, becomes involved in a traffic accident with the Price of Pop Jeremy Princeton. Concerned for Toms well-being, Jeremy insists Tom accompany him to his Santa Ynez estate Tierra Bella to consult with his in-house physician. While visiting the estate, Jeremys art consultant Peter Harrison shows him two paintings; a Renoir and a Rembrandt, which have been stolen from the Swedish National Museum and which were shipped to Jeremy anonymously in a shipment of musical instruments. Also in Jeremys possession is a mystical sphere called the Black Piper which is a mysterious and supernatural relic that at first is a god-send, but later becomes a curse. Enter Stephanie Kensington, an Interpol agent and Lynne Northland, an FBI paranormal psychologist who are assigned the Swedish National Museum case. The duo team up with a Swedish cop and a CIA agent to solve the mystery. The clues lead the group on an amazing and harrowing journey from Beirut to Stockholm to Cadiz to Ensenada where they uncover along the way some ancient mystical writings called the Emerald Tablets of Troth, a Franciscan monk whose knowledge can save the world from Armageddon, a demon called Wegreog, and a malevolent smuggling scheme led by one of the most powerful persons in the U.S. government. The Curse of the Black Piper is a light hearted tongue-in-cheek fictional adventure about three rogue sailors on a lark whose mischievous inclinations lead them into a labyrinth of extreme danger and mystical intrigue amidst the backdrop of todays contemporary world scene. The Curse of the Black Piper is an action packed, thrilling adventure that you wont want to put down.",
