          "publisher": "Lehigh University Press",
          "publishedDate": "1992",
          "description": "In this book, Paul T. Durbin presents a scholarly plea for social responsibility on the part of technical professionals. Examples chosen include biomedical researchers, computer professionals, nuclear experts, and ecologists, as well as medical educators, technology literacy educators, and media professionals. Even academic philosophers are urged to shoulder social responsibilities. While the language of social responsibility is not totally lacking in contemporary discussions of the ethical obligations of technical professionals, it is given a new urgency here. The background of the discussion is an increasing number of calls, by leaders of professional societies, urging their members to shoulder greater social responsibilities associated with contemporary social ills. What these calls seem most often to lack is a sense of urgency, a demand for activism on the part of technical professionals. The book aims to attack this failing head-on. A second part of the book attempts to answer philosophical objections to this sort of plea as a way of dealing with urgent contemporary issues. One sort of objection comes from radical critics saying that nothing can be done. But there are many other kinds of objections, and several of them are faced in this part of the book. The thesis defended in the study is straightforward and optimistic - namely, that something can be done to solve social problems, in spite of the difficulties. Where radical critics say nothing can be done, conservatives say that nothing ought to be done - at least nothing that smacks of social engineering. While these extreme views are addressed, the main focus is on mainstream activists in the technical professions. A secondary focus is on how more technical professionals can get involved so that the whole movement can be more effective in solving the problems discussed. Not everyone agrees that professionals - including academic philosophers - need to be actively engaged in this fashion. So another theme throughout is an argument against non-engaged philosophers, non-engaged scientists, and other non-engaged professionals. The social problems of a technological society are manifest. The book attempts to show, in a scholarly way, how they might be addressed effectively.",
