          "description": "Studienarbeit aus dem Jahr 2004 im Fachbereich Philosophie - Theoretische (Erkenntnis, Wissenschaft, Logik, Sprache), Note: 2.0, Universität Leipzig (Institut für Philosophie), Veranstaltung: Hauptseminar Utopien, Sprache: Deutsch, Abstract: „Space... The final frontier.“ Diese Worte markierten am 8. September 1966 den Beginn einer Erfolgsgeschichte, deren Ende noch nicht abzusehen ist. Raumschiff Enterprise flimmerte das erste Mal über die Bildschirme. Viele Menschen hat STAR TREK berührt und in seinen Bann gezogen. Dabei ist es eine Science Fiction-Serie, die wenig mit unserem heutigen Alltag gemein hat. Sie bietet ein Blick in eine zukünftige, womöglich bessere Welt und schildert ähnlich wie z.B. „Utopia“, „Die Insel Felsenburg“ oder „Nova Atlantis“ fiktive Reiseerlebnisse. Ebenso wie die genannten Werke versucht STAR TREK das Bild einer Gesellschaft zu vermitteln, die kaum noch Missstände kennt, in der Menschen in friedlicher Koexistenz leben. Doch kann man STAR TREK überhaupt als Utopie bezeichnen? Die überraschende Antwort lautet: \"Nein.\"",
